    - type: Paper
      content: >
        Дата: ██████

        Отчёт №1


        Мы обнаружили аномально радиоактивный кристалл при изучении хромитовых астероидов, кристалл переливается фиолетовым свечением и очень сильно фонит, объект был назван ███████. 


        На месте обнаружения развёрнута лаборатория по изучению аномалии, из за того, что при попытке взять кристалл он прожёг костюм радиоактивной защиты, нанеся сильную травму учёному ███ █████. 
  - uid: 401
