      parent: 1
    - type: Paper
      content: >+
        Дата: ██████

        Отчёт №2


        ███████ излучает радиацию в 16 рад, но это число постоянно варьируется, обычно оно находится в диапазоне от 10 до 20 рад, но у нас мало данных, чтобы делать выводы. 


        Также объект начинает разрушение всего вокруг себя, стены уже через неделю после постройки лаборатории начали ржаветь, а в системах электропитания постоянно происходят сбои, требуется улучшить условия содержания объекта, во избежании поломок. 
